// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Voting {
    // Structs
    struct Candidate {
        uint256 id;
        string name;
        uint256 voteCount;
        string imageUrl;
        uint256 age;
        string party;
    }

    struct Election {
        uint256 id;
        address creator;
        string title;
        bool isActive;
        uint256 candidatesCount;
        mapping(uint256 => Candidate) candidates;
        mapping(address => bool) hasVoted;
    }

    // State Variables
    mapping(uint256 => Election) public elections;
    uint256 public electionsCount;
    
    // Events
    event ElectionCreated(uint256 indexed electionId, address indexed creator, string title);
    event CandidateAdded(uint256 indexed electionId, uint256 indexed candidateId, string name);
    event VoteCast(uint256 indexed electionId, uint256 indexed candidateId, address indexed voter);
    event ElectionEnded(uint256 indexed electionId, string title);
    event WinnerDeclared(uint256 indexed electionId, uint256 indexed candidateId, string name, uint256 voteCount);

    function createElection(string memory _title) public returns (uint256) {
        require(bytes(_title).length > 0, "Title cannot be empty");
        
        electionsCount++;
        Election storage newElection = elections[electionsCount];
        newElection.id = electionsCount;
        newElection.creator = msg.sender;
        newElection.title = _title;
        newElection.isActive = true;
        
        emit ElectionCreated(electionsCount, msg.sender, _title);
        return electionsCount;
    }

    function addCandidate(
        uint256 _electionId,
        string memory _name,
        uint256 _age,
        string memory _party,
        string memory _imageUrl
    ) public {
        Election storage election = elections[_electionId];
        require(election.creator == msg.sender, "Only election creator can add candidates");
        require(election.isActive, "Election is not active");
        
        election.candidatesCount++;
        election.candidates[election.candidatesCount] = Candidate({
            id: election.candidatesCount,
            name: _name,
            voteCount: 0,
            imageUrl: _imageUrl,
            age: _age,
            party: _party
        });
        
        emit CandidateAdded(_electionId, election.candidatesCount, _name);
    }

    function vote(uint256 _electionId, uint256 _candidateId) public {
        Election storage election = elections[_electionId];
        require(election.isActive, "Election is not active");
        require(!election.hasVoted[msg.sender], "Already voted in this election");
        require(_candidateId > 0 && _candidateId <= election.candidatesCount, "Invalid candidate");

        election.hasVoted[msg.sender] = true;
        election.candidates[_candidateId].voteCount++;
        
        emit VoteCast(_electionId, _candidateId, msg.sender);
    }

    function endElection(uint256 _electionId) public {
        Election storage election = elections[_electionId];
        require(election.creator == msg.sender, "Only election creator can end election");
        require(election.isActive, "Election is not active");

        election.isActive = false;

        // Find winner
        uint256 winningVoteCount = 0;
        uint256 winnerId = 0;
        
        for(uint256 i = 1; i <= election.candidatesCount; i++) {
            if (election.candidates[i].voteCount > winningVoteCount) {
                winningVoteCount = election.candidates[i].voteCount;
                winnerId = i;
            }
        }

        if (winnerId > 0) {
            emit WinnerDeclared(
                _electionId,
                winnerId,
                election.candidates[winnerId].name,
                winningVoteCount
            );
        }

        emit ElectionEnded(_electionId, election.title);
    }

    // View Functions
    function getElection(uint256 _electionId) public view returns (
        uint256 id,
        address creator,
        string memory title,
        bool isActive,
        uint256 candidatesCount
    ) {
        Election storage election = elections[_electionId];
        return (
            election.id,
            election.creator,
            election.title,
            election.isActive,
            election.candidatesCount
        );
    }

    function getCandidate(uint256 _electionId, uint256 _candidateId) public view returns (
        uint256 id,
        string memory name,
        uint256 voteCount,
        string memory imageUrl,
        uint256 age,
        string memory party
    ) {
        Election storage election = elections[_electionId];
        require(_candidateId > 0 && _candidateId <= election.candidatesCount, "Invalid candidate");
        
        Candidate memory candidate = election.candidates[_candidateId];
        return (
            candidate.id,
            candidate.name,
            candidate.voteCount,
            candidate.imageUrl,
            candidate.age,
            candidate.party
        );
    }

    function hasUserVoted(uint256 _electionId, address _voter) public view returns (bool) {
        return elections[_electionId].hasVoted[_voter];
    }
}

